webpackJsonp([67817571669034],{2586:function(e,o){e.exports={pathContext:{docHtml:'<h1>string_decoder</h1>\n<p><strong><em>Node-core v7.0.0 string_decoder for userland</em></strong></p>\n<p><a href="https://nodei.co/npm/string_decoder/"><img src="https://nodei.co/npm/string_decoder.png?downloads=true&#x26;downloadRank=true" alt="NPM"></a>\n<a href="https://nodei.co/npm/string_decoder/"><img src="https://nodei.co/npm-dl/string_decoder.png?&#x26;months=6&#x26;height=3" alt="NPM"></a></p>\n<pre><code class="language-bash">npm install --save string_decoder\n</code></pre>\n<p><strong><em>Node-core string<em>decoderstring</em>decoder for userland</em></strong></p>\n<p>This package is a mirror of the string_decoder implementation in Node-core.</p>\n<p>Full documentation may be found on the <a href="https://nodejs.org/dist/v7.8.0/docs/api/">Node.js website</a>.</p>\n<p>As of version 1.0.0 <strong>string_decoder</strong> uses semantic versioning.</p>\n<h2>Previous versions</h2>\n<p>Previous version numbers match the versions found in Node core, e.g. 0.10.24 matches Node 0.10.24, likewise 0.11.10 matches Node 0.11.10.</p>\n<h2>Update</h2>\n<p>The <em>build/</em> directory contains a build script that will scrape the source from the <a href="https://github.com/nodejs/node">nodejs/node</a> repo given a specific Node version.</p>',docPath:"argo-ci/node_modules/fsevents/node_modules/string_decoder/readme",proj:"argo-ci"}}}});
